import React from "react";
import Data from "../Data";
import CarRent from "../Pages/CarRent/CarRent";
import "../Pages/Carspage/Carspage.css";
import CarsHolder from "../Components/Cars/CarsHolder";
function RentalPage() {
  const Holder = Data.map((item) => <CarsHolder key={item.id} />);
  console.log(Holder);
  return (
    <div>
      <CarRent Data={Data} />
      <div className="nested-car-page">{Holder === true ? Holder : ""}</div>
    </div>
  );
}

export default RentalPage;
